import React, { Component } from 'react'

export default class dashboard extends Component {
constructor(props) {
    super(props)

    this.state = {
         ...JSON.parse(localStorage.getItem("userData"))
    }
}

    render() {
        return (
            <div style={{margin:"12rem 0"}}>
                <h1>Hello {this.state.lastName} Welcome to FarmFund</h1>
            </div>
        )
    }
}
